import type { ImgHTMLAttributes } from "react";
import { createElement } from "react";

export type SVVIconProps = ImgHTMLAttributes<HTMLImageElement>;

export function CircleXmarkSolid({ alt = "", ...props }: SVVIconProps) {
  return createElement("img", { ...props, alt, src: circleXmarkSolid });
}

export function MagnifyingGlass({ alt = "", ...props }: SVVIconProps) {
  return createElement("img", { ...props, alt, src: magnifyingGlass });
}

